CREATE TABLE DIAMOND_STONES (
    id VARCHAR(255) PRIMARY KEY NOT NULL,
    data_id VARCHAR(255) NOT NULL,
    group_id VARCHAR(128) NOT NULL,
    content LONGTEXT NOT NULL,
    description LONGTEXT,
    valid TINYINT(1) DEFAULT '1' NOT NULL,
    gmt_create DATETIME NOT NULL,
    gmt_modified DATETIME NOT NULL
);
CREATE UNIQUE INDEX uk_diamond_datagroup ON DIAMOND_STONES (data_id, group_id);


CREATE TABLE TD_M_UNICOM_ERROR_RELATION (
    error_code VARCHAR(30) NOT NULL,
    unicom_code VARCHAR(30) NOT NULL,
    error_message VARCHAR(500)
);

